DROP TABLE IF EXISTS `task`;
CREATE TABLE `task` (
  `description` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci COMMENT '简介',
  `sort_no` float DEFAULT NULL COMMENT '排序',
  `del_flag` smallint DEFAULT NULL COMMENT '软删除标记',
